import React from 'react';

import ButtonBlock from './ButtonBlock';

function AutomationButtonBlock(props) {

    const namesLetters_A = {
        'letter1': props.match.params.name.toUpperCase(),
        'letter2': 'A',
        'letter3': ''
    }
    const classnameLetters = {
        'classnameLetter1': 'letter1',
        'classnameLetter2': 'letter2',
        'classnameLetter3': 'letter3'
    }
    const hendlerButtonClick = () => {
        console.log('click letter button');
    }

    return (
        <div className="">

            <h2>Тип буквы {props.match.params.id} буква {props.match.params.name}</h2>

            <ButtonBlock
                onclick={hendlerButtonClick}
                namesLettersButton_1={namesLetters_A }
                namesLettersButton_2={namesLetters_A }
                namesLettersButton_3={namesLetters_A }
            />

        </div>
        
     )
}

export default AutomationButtonBlock
